import { useEffect } from 'react';
import { Router, Routes } from 'react-router-dom';
import './App.css';
import { Header } from './components/Header/Header';
import useTelegram from './hooks/useTelegram';

function App() {
	const { tg } = useTelegram();

	useEffect(() => {
		tg.ready();
	}, [tg]);

	return (
		<div className='App'>
			<Header />
			<Routes>
				<Router></Router>
			</Routes>
		</div>
	);
}

export default App;
